"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[315],{2729:function(e){e.exports=JSON.parse('{"route":"talks","tag":"Online","articles":[{"title":"MVP Conf: Tech Talk","slug":"mvp-conf%3A-tech-talk","date":"2025-08-27","authors":["Weslley Ara\xfajo"],"tags":["BR","Online"],"content":"\\n\ud83d\udcf9 **Palestra (Live):** GitHub Beyond Code: overcoming in the job market through open source\\n\\n:::note Summary\\nAimed at new developers, I spoke about the impact that open source and **GitHub** can have on our careers, on the **TechTalk** program from the [**MVP Conf**](https://www.youtube.com/@mvpconf) channel, hosted by [**Vanessa Valle**](https://www.linkedin.com/in/vanessabrava/) and [**Renata Correa**](https://www.linkedin.com/in/correa-renata-ti/).\\n:::\\n\\n{/* truncate */}\\n\\nFocusing on how to stand out in an increasingly competitive market, I show how open source can accelerate your technical growth, enabling you to achieve unimaginable milestones that directly impact your professional career.\\n\\nIn a market that is more competitive every day, open source is not just about code \u2014 it\'s a direct bridge to technical growth, global visibility, and real career opportunities.\\n\\nWith visual, human, and real examples, I want to inspire you and bring an optimistic perspective of yourself in an increasingly intimidating world, especially with the rise of artificial intelligence, using open source strategically to build credibility and trust in the market.\\n\\n:::tip\\n[You can watch the live replay on the official **MVP Conf** **YouTube** channel \u2728](https://www.youtube.com/watch?v=alfJ6aEJhhA)\\n:::\\n","filePath":"mvpconf-techtalk.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/08/27/mvpconf-techtalk.mdx","summary":[],"description":"\ud83d\udcf9 **Palestra (Live):** GitHub Beyond Code: overcoming in the job market through open source\\n\\n:::note Summary\\nAimed at new developers, I spoke about the impact that open source and **GitHub** can have on our careers, on the **TechTalk** program from the [**MVP Conf**](https://www.youtube.com/@mvpconf) channel, hosted by [**Vanessa Valle**](https://www.linkedin.com/in/vanessabrava/) and [**Renata Correa**](https://www.linkedin.com/in/correa-renata-ti/).\\n:::","social":"./banner.png","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/08/27/banner.png","readingTime":1,"lastModified":"2025-12-22T01:10:36.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"Roga DX","slug":"roga-dx","description":"\ud83c\udf99\ufe0f **Talk:** Uncovering Tests: Creating Secure and Resilient Systems\\n\\n:::note Summary\\n\\n- Test the functionality of our application? \u2705\\n- Break our application before the user or an attacker? That\'s different.\\n\\n:::\\n\\n:::tip Bonus\\n\\nIn addition to the lecture, I had the immense pleasure of recording an episode of the podcast from [**Curso em V\xeddeo**](https://www.youtube.com/cursoemvideo) with, simply, [**Gustavo Guanabara**](https://www.instagram.com/gustavoguanabara/) \ud83d\udd96\\n\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/09/13/banner.jpeg"},"nextArticle":{"title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","slug":"semana-de-sistemas-de-informacao-each-usp","description":"\ud83c\udf99\ufe0f **Keynote:** GitHub Beyond Code: overcoming in the job market through open source\\n\\n:::note\\nSpeaking at a university ([**USP**](https://www5.each.usp.br/)) is special in itself, but closing the day\'s event made it even more special \u2728\\n\\nThe [**SSI**](https://www.semanadesi.com/) is an event organized by the university students themselves, and I had the pleasure of being invited to teach through open source, using **GitHub** as a learning tool.\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/08/21/banner.jpeg"}},{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","slug":"winx-day-luciano-dii-souza-o-primo-dev","date":"2025-06-14","authors":["Weslley Ara\xfajo"],"tags":["BR","Online"],"content":"\\n\ud83d\udcf9 **Live (Talk):** Overcoming impostor syndrome and the challenges of existing in the market through open source.\\n\\n:::info\\nAn online event organized by [**Luciano dii Souza**](https://www.linkedin.com/in/lucianodiisouza/), with a relaxed approach and held through the [**Discord**](https://discord.gg/wyrRdpGKmj) community for developers, aiming to share experiences and knowledge, especially for those who are just starting in the field.\\n:::\\n\\n{/* truncate */}\\n\\nAt this moment when many developers feel insecure about the future of the field:\\n\\n- Is my level sufficient?\\n- Should I give up if I can\'t get a job in my field?\\n- How do I gain experience if the market doesn\'t give me opportunities?\\n- After all, will Artificial Intelligence replace developers or not?\\n\\nBringing up sensitive topics like insecurity, inferiority complex, and self-sabotage, with a light at the end of the tunnel through open source initiatives, was quite challenging but very interesting.\\n\\nThis is a talk where I expose the insecurities during my journey, speaking in a tone close to what would be a heartfelt confession.\\n\\nThe intention is to connect with those participating, evolve toward learning, and perhaps inspire through my story, sharing the human side that social networks and \\"LinkedIn titles\\" don\'t show.\\n","filePath":"winx-day.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/06/14/winx-day.mdx","summary":[],"description":"\ud83d\udcf9 **Live (Talk):** Overcoming impostor syndrome and the challenges of existing in the market through open source.\\n\\n:::info\\nAn online event organized by [**Luciano dii Souza**](https://www.linkedin.com/in/lucianodiisouza/), with a relaxed approach and held through the [**Discord**](https://discord.gg/wyrRdpGKmj) community for developers, aiming to share experiences and knowledge, especially for those who are just starting in the field.\\n:::","social":"./banner.png","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/06/14/banner.png","readingTime":1,"lastModified":"2025-12-22T01:10:36.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","slug":"codecon-summit-embrace-the-hacker-way","description":"\ud83c\udf99\ufe0f **Talk:** Creating a Test Runner: What happens behind the tests?\\n\\n:::note Summary\\nThere\'s a lot of talk about testing, but what\'s it like to create a test runner from scratch?  \\nMore than that: how do you test a test runner?\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/07/19/banner.jpeg"},"nextArticle":{"title":"GitHub Brasil \u2014 Open Source Friday","slug":"github-brasil-open-source-friday","description":"\ud83d\udcf9 **Talk (Live):** Meeting [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nIn a conversation that was both technical and casual, I had the honor of kicking off the very first edition of **Open Source Friday** by [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), hosted by [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/03/14/banner.png"}},{"title":"GitHub Brasil \u2014 Open Source Friday","slug":"github-brasil-open-source-friday","date":"2025-03-14","authors":["Weslley Ara\xfajo"],"tags":["BR","Online"],"content":"\\n\ud83d\udcf9 **Talk (Live):** Meeting [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nIn a conversation that was both technical and casual, I had the honor of kicking off the very first edition of **Open Source Friday** by [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), hosted by [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::\\n\\n{/* truncate */}\\n\\nDuring the live session, I was able to share a bit about myself, the importance of open source, motivations, challenges, and future plans for [Poku](https://github.com/wellwelwel/poku), as well as give some great tips for those who want to contribute for the first time, especially for those who feel insecure.\\n\\nIn one hour of live streaming, there were conversations, low vs. too-high microphone volume, explanations about module systems, and the differences in behavior between **Node.js**, **Bun**, and **Deno**.\\n\\nThere was even live coding, demonstrating in practice why other test runners are not fully compatible with all JavaScript backends and how **Poku** challenges more than 12 years of language history by bringing JavaScript\'s natural flow to testing.\\n\\n:::tip\\n\\n[You can replay the live session on the official **GitHub Brasil** **LinkedIn** \ud83d\udc37](https://www.linkedin.com/events/7305618122546294807/comments/)\\n\\n:::\\n","filePath":"github-brasil.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/03/14/github-brasil.mdx","summary":[],"description":"\ud83d\udcf9 **Talk (Live):** Meeting [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nIn a conversation that was both technical and casual, I had the honor of kicking off the very first edition of **Open Source Friday** by [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), hosted by [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::","social":"./banner.png","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/03/14/banner.png","readingTime":1,"lastModified":"2025-12-22T01:10:36.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","slug":"winx-day-luciano-dii-souza-o-primo-dev","description":"\ud83d\udcf9 **Live (Talk):** Overcoming impostor syndrome and the challenges of existing in the market through open source.\\n\\n:::info\\nAn online event organized by [**Luciano dii Souza**](https://www.linkedin.com/in/lucianodiisouza/), with a relaxed approach and held through the [**Discord**](https://discord.gg/wyrRdpGKmj) community for developers, aiming to share experiences and knowledge, especially for those who are just starting in the field.\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/06/14/banner.png"},"nextArticle":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg","description":"\ud83c\udf99\ufe0f **Talk:** Overcoming the impostor syndrome and the challenges of existing in the industry through open-source.\\n\\n:::note Summary\\nAt a time when many developers feel insecure about the future of the field, bringing up sensitive topics like insecurity, inferiority complex, and self-sabotage, with a light at the end of the tunnel through open source initiatives, was quite challenging but very interesting:\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2024/11/23/banner.png"}},{"title":"Microsoft Reactor e NodeBR","slug":"microsoft-reactor-e-nodebr","date":"2024-08-30","authors":["Weslley Ara\xfajo"],"tags":["BR","SP","S\xe3o Paulo","Online"],"content":"\\n\ud83c\udf99\ufe0f **Talk:** Creating a High-Performance Multi-Platform Test Runner.\\n\\n:::note\\nThe focus of the talk was on the importance of delegating each problem\'s responsibilities using native **Node.js** features.\\n:::\\n\\n{/* truncate */}\\n\\nWith the theme \\"API Like a Boss\\", I had the opportunity to teach using [**Poku**](https://github.com/wellwelwel/poku).\\n\\nInstead of just talking about Poku itself, I also used Poku as an analogy, teaching about subprocesses and the differences between **Node.js**, **Bun**, and **Deno**.\\n\\n:::tip\\n\\n[See the slides used in the talk \ud83d\udc37](https://drive.google.com/file/d/16XxIt_pov5aBidGjIwC4V_riYq3PMlrB/view)\\n\\n:::\\n","filePath":"microsoft-reactor-e-nodebr.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2024/08/30/microsoft-reactor-e-nodebr.mdx","summary":[],"description":"\ud83c\udf99\ufe0f **Talk:** Creating a High-Performance Multi-Platform Test Runner.\\n\\n:::note\\nThe focus of the talk was on the importance of delegating each problem\'s responsibilities using native **Node.js** features.\\n:::","social":"./banner.jpeg","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2024/08/30/banner.jpeg","readingTime":1,"lastModified":"2025-12-22T01:10:36.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg","description":"\ud83c\udf99\ufe0f **Talk:** Overcoming the impostor syndrome and the challenges of existing in the industry through open-source.\\n\\n:::note Summary\\nAt a time when many developers feel insecure about the future of the field, bringing up sensitive topics like insecurity, inferiority complex, and self-sabotage, with a light at the end of the tunnel through open source initiatives, was quite challenging but very interesting:\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2024/11/23/banner.png"}}]}')}}]);